import {Button, Descriptions} from 'antd';


function ProductInfo(props) {
  return (
    <div>
        <Descriptions title="Product Info">
            <Descriptions.Item label="Price">Cloud Database</Descriptions.Item>
            <Descriptions.Item label="Sold">Prepaid</Descriptions.Item>
            <Descriptions.Item label="View">YES</Descriptions.Item>
            <Descriptions.Item label="Descrition"></Descriptions.Item>
        
        </Descriptions>,
    </div>
  )
}

export default ProductInfo
